import React, { useState } from 'react';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="bg-blue-500 p-4">
      <div className="container mx-auto flex items-center justify-between">
        <div className="text-white font-bold text-xl">Disaster Management</div>
        <div className="md:hidden">
          <button onClick={() => setIsOpen(!isOpen)}>
            <svg className="w-6 h-6 text-white" fill="none" strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" viewBox="0 0 24 24" stroke="currentColor">
              {isOpen ? (
                <path d="M6 18L18 6M6 6l12 12"></path>
              ) : (
                <path d="M4 6h16M4 12h16m-7 6h7"></path>
              )}
            </svg>
          </button>
        </div>
        <div className={`md:flex items-center ${isOpen ? 'block' : 'hidden'}`}>
          <a href="#home" className="text-white p-2 hover:bg-blue-700">Home</a>
          <a href="#services" className="text-white p-2 hover:bg-blue-700">Services</a>
          <a href="#about" className="text-white p-2 hover:bg-blue-700">About</a>
          <a href="#contact" className="text-white p-2 hover:bg-blue-700">Contact</a>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
